<span class="line"><span style="color: #E5C07B">console</span><span style="color: #ABB2BF">.</span><span style="color: #61AFEF">log</span><span style="color: #ABB2BF">(</span><span style="color: #E5C07B">copy</span><span style="color: #ABB2BF">.</span><span style="color: #E06C75">a</span><span style="color: #ABB2BF">);</span></span>
